import { store } from './redux/store';
import { BrowserRouter as Router , Routes , Route } from 'react-router-dom';
import './App.css';
import Cover from './Container/Cover/Cover';
import { Provider } from 'react-redux';


function App() {

  return (
    <Router>
      <Routes>


         <Route path='/' element={
            <Provider store={store}>
              <Cover/>
              </Provider>
              } />


     </Routes>
    </Router>


  );
}

export default App;
